import React from 'react';
import { 
  Heading,
  Paragraph,
  Card,
  Box,
  Tag,
  Link
} from '@digdir/designsystemet-react';
import Timeline from '../components/Timeline';

interface ChangelogEntry {
  version: string;
  date: string;
  type: 'major' | 'minor' | 'patch';
  changes: {
    type: 'added' | 'changed' | 'deprecated' | 'removed' | 'fixed';
    description: string;
    pr?: number;
  }[];
}

const changelog: ChangelogEntry[] = [
  {
    version: '0.63.1',
    date: '2023-11-25',
    type: 'patch',
    changes: [
      {
        type: 'fixed',
        description: 'Fixed TypeScript definitions for Button component',
        pr: 245
      },
      {
        type: 'fixed',
        description: 'Improved accessibility for Tag component',
        pr: 246
      }
    ]
  },
  {
    version: '0.63.0',
    date: '2023-11-20',
    type: 'minor',
    changes: [
      {
        type: 'added',
        description: 'Added new Timeline component',
        pr: 240
      },
      {
        type: 'changed',
        description: 'Updated color system tokens',
        pr: 242
      }
    ]
  },
  {
    version: '0.62.0',
    date: '2023-11-15',
    type: 'minor',
    changes: [
      {
        type: 'added',
        description: 'Added dark mode support',
        pr: 235
      },
      {
        type: 'deprecated',
        description: 'Deprecated old color tokens',
        pr: 236
      }
    ]
  }
];

const getChangeTypeColor = (type: ChangelogEntry['changes'][0]['type']) => {
  switch (type) {
    case 'added':
      return 'success';
    case 'changed':
      return 'warning';
    case 'deprecated':
      return 'neutral';
    case 'removed':
      return 'danger';
    case 'fixed':
      return 'info';
    default:
      return 'neutral';
  }
};

const getVersionColor = (type: ChangelogEntry['type']) => {
  switch (type) {
    case 'major':
      return 'danger';
    case 'minor':
      return 'warning';
    case 'patch':
      return 'success';
    default:
      return 'neutral';
  }
};

const Changelog: React.FC = () => {
  return (
    <div>
      <Heading level={1} size="xlarge" spacing>Changelog</Heading>
      <Paragraph spacing>
        Track all changes and updates to Designsystemet components and features.
        Each entry links to the corresponding GitHub pull request.
      </Paragraph>

      <Timeline>
        {changelog.map((entry) => (
          <Timeline.Item key={entry.version}>
            <Card>
              <Box padding="4">
                <div style={{ display: 'flex', alignItems: 'center', gap: '1rem', marginBottom: '1rem' }}>
                  <Tag size="small" color={getVersionColor(entry.type)}>
                    v{entry.version}
                  </Tag>
                  <Paragraph size="small" spacing={false}>
                    {entry.date}
                  </Paragraph>
                </div>

                <div>
                  {entry.changes.map((change, index) => (
                    <div
                      key={index}
                      style={{
                        display: 'flex',
                        alignItems: 'flex-start',
                        gap: '1rem',
                        marginBottom: index < entry.changes.length - 1 ? '1rem' : 0
                      }}
                    >
                      <Tag size="small" color={getChangeTypeColor(change.type)}>
                        {change.type}
                      </Tag>
                      <div>
                        <Paragraph spacing={false}>
                          {change.description}
                          {change.pr && (
                            <Link
                              href={`https://github.com/digdir/designsystemet/pull/${change.pr}`}
                              style={{ marginLeft: '0.5rem' }}
                            >
                              #{change.pr}
                            </Link>
                          )}
                        </Paragraph>
                      </div>
                    </div>
                  ))}
                </div>
              </Box>
            </Card>
          </Timeline.Item>
        ))}
      </Timeline>
    </div>
  );
};

export default Changelog;
